Synopsis

The film is shown to be a reflection of the current socio-political system, based on the violence against women.[2] It revolves around a person who arrives in Trivandrum city who takes a ride from place to place in an Autorickshaw.[3] His name or whereabouts are not revealed, and he just travels from place to place in the auto rickshaw. The questions about his whereabouts form the rest of the story.


